import { Row, Col, Button, Card } from 'antd';


import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
      <h1>Noemi Romano</h1>
      <Row>
      <Col span={12}>
      <h1>A new island in Venice</h1>
      <p>In this project, we imagined a new island in Venice.</p>
      </Col>
      <Col span={12}>  <img src={process.env.PUBLIC_URL + '/triangulation.png'} alt='arsenaletop'/></Col>
    </Row>

      </div>
    );
  }
}

export default App;
